pma:database.pma:table:
CREATE TABLE `administrator` (
  `Username` varchar(15) NOT NULL,
  `Password` varchar(100) NOT NULL,
  PRIMARY KEY (`Username`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

CREATE TABLE `extracurricular` (
  `extraIndex` int(3) NOT NULL AUTO_INCREMENT,
  `Department` varchar(100) DEFAULT NULL,
  `Field` varchar(100) DEFAULT NULL,
  PRIMARY KEY (`extraIndex`)
) ENGINE=InnoDB AUTO_INCREMENT=108 DEFAULT CHARSET=latin1;

CREATE TABLE `extradepartment` (
  `departmentIndex` int(3) NOT NULL AUTO_INCREMENT,
  `Department` varchar(100) NOT NULL,
  PRIMARY KEY (`departmentIndex`),
  UNIQUE KEY `Department` (`Department`)
) ENGINE=InnoDB AUTO_INCREMENT=11 DEFAULT CHARSET=latin1;

CREATE TABLE `permanent` (
  `StudentEmail` varchar(100) NOT NULL,
  `Reason` varchar(1000) DEFAULT NULL,
  `Year` varchar(100) DEFAULT NULL,
  PRIMARY KEY (`StudentEmail`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;
